How to print database names and their collections names in order using nodeJS MongoClient?<p>I'm trying to print list of database names following their corresponding collection names using a nested loop with MongoDB Node.js Driver.</p>

<p><strong>Database A:</strong><br>
Collection a<br>
Collection b<br>
<strong>Database B:</strong><br>
Collection f<br>
Collection g<br>
<strong>Database C:</strong><br>
Collection h<br>
Collection j</p>

<p>but instead I get this:<br>
<strong>Database A:</strong><br>
<strong>Database B:</strong><br>
<strong>Database C:</strong><br>
Collection a<br>
Collection b<br>
Collection f<br>
Collection g<br>
Collection h<br>
Collection j</p>

<p>What am I doing wrong? Is this because <code>listDatabases()</code> and <code>listCollections()</code> sharing the same MongoClient connection and they can't be executed simultaneously or it is just <code>promise</code> thing?</p>

<pre><code>const mongo = require('mongodb').MongoClient;

const url = 'mongodb://127.0.0.1:27017';

mongo.connect(url, {
    useNewUrlParser: true,
    useUnifiedTopology: true
}, (err, client) =&gt; {
    if (err) {
        console.log(err)
        return;
    }
    // print db names with their corresponding collections
    client.db().admin().listDatabases({ nameOnly: true }, (err, result) =&gt; {
        if (!err) {
            result.databases.forEach((db) =&gt; {
                console.log('Database: ' + db.name);

                client.db(db.name).listCollections().toArray((err, collections) =&gt; {
                    collections.forEach((col) =&gt; {
                        console.log(col.name);
                    });
                });

            });
        } else {
            return console.log(err.message);
        }
    });
});
</code></pre>

