How to retrieve just the array values only of a nested field of MongoDB document?<p>I'm trying to deep query and retrieve specific fields from MongoDB, but unfortunately couldn't able to figure out the correct solution.</p>

<p><strong>Document data</strong>:</p>

<pre><code>[ {
   "_id": 39127198,
   "name": "Mike",
   "details": {
      "age": 25,
      "vehicles":[
         {"brand":"Chevrolet","model":"Silverado","plate":"AB11"}, 
         {"brand":"Jeep","model":"Cherokee","plate":"CG678"}
      ]
   }
}, {
   "_id": 39127198,
   "name": "Taylor",
   "details": {
      "age": 25,
      "vehicles": [
          {"brand":"GMC","model":"Sierra","plate":"748397"}
      ]
   }
} ]
</code></pre>

<p><strong>My requirement</strong>: Return "vehicles" array alone for a specific player. Let's say for user "Mike" in this case. </p>

<p><strong>Here is what I tried</strong>;</p>

<pre><code>collection.find( {"name":"Mike"} )
          .project( {"details.vehicles" : 1, "_id": 0, "name": 0} )
          .toArray(function(err, result) { ... } )

collection.aggregate([
  { $match: { "name":"Mike" } },
  { $project: {"details.vehicles" : 1, "_id": 0, "name": 0} }
]).toArray(function(err, result) { ... } )
</code></pre>

<p><strong>Here is what I get for the above code</strong>:</p>

<pre><code>[
   {
     "details": {
       "vehicles": [
         {"brand":"Chevrolet","model":"Silverado","plate":"AB11"}, 
         {"brand":"Jeep","model":"Cherokee","plate":"CG678"}
       ]
     }
   }
]
</code></pre>

<p><strong>Expected</strong>: </p>

<pre><code>[
   {"brand":"Chevrolet","model":"Silverado","plate":"AB11"}, 
   {"brand":"Jeep","model":"Cherokee","plate":"CG678"}
]
</code></pre>

<p>I am using MongoClient. MongoDB shell version v4.2.1  </p>

