Merging / aggregating multiple documents in MongoDB<p><br>
I have a little problem with my aggregations. I have a large collection of flat documents with the following schema:</p>

<pre><code>{
  _id:ObjectId("5dc027d38da295b969eca568"),
  emp_no:10001,
  salary:60117,
  from_date:"1986-06-26",
  to_date:"1987-06-26"
}
</code></pre>

<p>It's all about annual employee salaries. The data is exported from relational database so there are multiple documents with the same value of <em>"emp_no"</em> but the rest of their attributes vary. I need to aggregate them by values of attribute "emp_no" so as a result I will have something like this:</p>

<pre><code>//one document
{
  _id:ObjectId("5dc027d38da295b969eca568"),
  emp_no:10001,
  salaries: [
    {
      salary:60117,
      from_date:"1986-06-26",
      to_date:"1987-06-26"
    },
    {
      salary:62102,
      from_date:"1987-06-26",
      to_date:"1988-06-25"
    },
    ...
  ]
}

//another document
{
  _id:ObjectId("5dc027d38da295b969eca579"),
  emp_no:10002,
  salaries: [
    {
      salary:65828,
      from_date:"1996-08-03",
      to_date:"1997-08-03"
    },
    ...
  ]
}

//and so on
</code></pre>

<p>Last but not least there are almost 2.9m of documents so aggregating by <em>"emp_no"</em> manually would be a bit of a problem. <br> Is there a way I can aggregate them using just mongo queries? How do I do this kind of thing? Thank you in advance for any help</p>

